#include <malloc.h>
#include <stdio.h>

static long list_counter = 0;   /* the number of lists allocated so far */

typedef struct Node {
        struct Node * pre;      /* how to access the prior Node */
        struct Node * next;     /* how to access the next Node */
        void * data;            /* the data to store */
} Node;

/* we want to make this a circularly-linked doubly-linked list */
typedef struct List {
        Node * front;             /* the front of the list */
        long list_count;        /* which list is it */
        long occupancy;
        void *(*copy_func) (void *);
        void (*delete_func) (void *);
        long (*is_greater_than_func) (void *, void *);
        FILE *(*write_func) (void *, FILE *);
} List;

List * new_List (
        void *(*copy_func) (void *),
        void (*delete_func) (void *),
        long (*is_greater_than_func) (void *, void *),
        FILE *(*write_func) (void *, FILE *)) {
  list_counter++;
  List* n = (List*)malloc(sizeof(*n)); /* assume malloc doesn't fail! */
  n->front = NULL;
  n->list_count = list_counter;
  n->occupancy = 0;
  n->copy_func = copy_func;
  n->delete_func = delete_func;
  n->is_greater_than_func = is_greater_than_func;
  n->write_func = write_func;
  return n;
}
static Node* new_Node (void * element, void * (*copy_func) (void *)) {
        Node *this_Node = (Node *) malloc (sizeof (Node));
        this_Node->next = this_Node->pre = NULL;
        this_Node->data = (copy_func) ? (*copy_func) (element) : element;
        return this_Node;
}

static Node * insert_Node (Node * this_Node, void * element,
        void * (*copy_func) (void *)) {
  Node* n = (Node*)malloc(sizeof(*n));
  if (copy_func) {
    n->data = copy_func(element);
  } else {
    n->data = element;
  }
  n->next = this_Node;
  n->pre = this_Node->pre;
  this_Node->pre = n;
  n->pre->next = n;  
  return n;
}

long insert (List * this_list, void * element, long where) {
  if (where == 1) {
    if (this_list->front) {
      this_list->front = insert_Node(this_list->front, element, this_list->copy_func);
    } else { /* empty list*/
      this_list->front = new_Node(element, this_list->copy_func);
      // make this a circularly-linked list:
      this_list->front->next = this_list->front;
      this_list->front->pre = this_list->front;
    }
